import React from 'react';

// Define the types of sections available
type Section = 'home' | 'creator';

// Define the types for the props, ensuring `onSectionChange` is properly typed
interface HeaderProps {
  onSectionChange: (section: Section) => void;
}

const Header: React.FC<HeaderProps> = ({ onSectionChange }) => {
  return (
    <div className="pt-10 px-6 sm:px-24 flex justify-between">
      <div className="flex items-center text-white font-bold">
        <img src="/pulse-logo.png" alt="Pulse Logo" className="h-12" />
      </div>
      <div className="w-[441px] h-[39px] p-2.5 justify-center items-center gap-10 inline-flex">
        <div>
          <button className="text-zinc-800 text-base font-bold capitalize"
            onClick={() => onSectionChange('home')}>Features</button>
          <div className="w-[70px] h-[1.80px] bg-black"></div>
        </div>
        <button className="text-gray-700 text-base font-medium capitalize"
          onClick={() => onSectionChange('creator')}>Creators</button>
        <button className="text-gray-700 text-base font-medium capitalize">Pricing</button>
        <button className="text-gray-700 text-base font-medium capitalize">Support</button>
        <a href="mailto:pulsefitnessapp@gmail.com" className="text-gray-700 text-base font-medium capitalize">Contact Us</a>
      </div>
    </div>
  );
};

export default Header;
